pragma solidity ^0.8.0;

/**
 * @dev Implementation of the { IWhitelist } interface
 */

import "../scm-interfaces/iscm-11.sol";
import "../access/Ownable.sol";

abstract contract Whitelist is IWhitelist, Ownable {

    // Whitelisted member data
    struct Whitelisted {
        uint256 numToMint;
        uint256 mintPrice;
    }

    // Maps addresses to whitelisted member's data
    mapping(address => Whitelisted) private _whitelist;


    /*
     * { IWhitelist } - addToWhitelist()
     */
    function addToWhitelist(
        address[] calldata whitelisted, 
        uint256 numAllowed,
	    uint256 mintPrice
    ) public override onlyOwner {
        for(uint i = 0; i < whitelisted.length; i++) {
            require(whitelisted[i] != address(0), "Zero address cannot be whitelisted");

            _whitelist[whitelisted[i]].numToMint = numAllowed;
            _whitelist[whitelisted[i]].mintPrice = mintPrice;
        }
    }

    /*
     * { IWhitelist } - addToWhitelist()
     */
    function removeFromWhitelist(address[] calldata removed) public override onlyOwner {
        for(uint i = 0; i < removed.length; i++) {
            delete(_whitelist[removed[i]]);
        }
    }

    /*
     * { IWhitelist } - addToWhitelist()
     */
    function isWhitelisted(address account) public view override returns(bool) {
        if(_whitelist[account].numToMint > 0) return true;
        else return false;
    }

    /*
     * {} - Public function to return data of a whitelisted member 
     */
    function whitelistedData(address account) public view returns(uint256, uint256) {
        require(isWhitelisted(account), "Address is not whitelisted");
        return (
            _whitelist[account].numToMint,
            _whitelist[account].mintPrice
        );
    }

    /*
     * {} - Internal function to be called after minting to update address data
     */
    function _resetAfterMint(address account, uint256 minted) internal {
        if (_whitelist[account].numToMint >= minted) {
            _whitelist[account].numToMint -= minted;
        } else {
            revert("Max number of tokens allowed to mint exceeded");
        }
    }

}
